from functools import lru_cache

class Solution:
    def getLengthOfOptimalCompression(self, s: str, k: int) -> int:
        @lru_cache(None)
        def dp(i, prev, ct, remaining):
            if remaining < 0:
                return float('inf')
            if i == len(s):
                return 0
            if (i, prev, ct, remaining) in dct:
                return dct[(i, prev, ct, remaining)]

            res = float('inf')
            if s[i] == prev:
                inc = dp(i + 1, prev, ct + 1, remaining)
                exc = dp(i + 1, prev, ct, remaining - 1)
                res = min(inc, exc + (2 if ct == 1 or ct == 9 else 0))
            else:
                inc = dp(i + 1, s[i], 1, remaining)
                exc = dp(i + 1, prev, ct, remaining - 1)
                res = min(inc + (1 if ct > 1 else 0), exc)

            dct[(i, prev, ct, remaining)] = res
            return res

        dct = {}
        return dp(0, '', 0, k)

# Test the cases
assert(Solution().getLengthOfOptimalCompression("aaabcccd", 2) == 4)
assert(Solution().getLengthOfOptimalCompression("aabbaa", 2) == 2)
assert(Solution().getLengthOfOptimalCompression("aaaaaaaaaaa", 0) == 3)

