from typing import *
from collections import Counter, defaultdict

class Solution:
    def minimumTotalCost(self, nums1: List[int], nums2: List[int]) -> int:
        n = len(nums1)

        # Initialize counters for nums1 and nums2
        z = Counter(nums1)
        z1 = Counter(nums2)

        # Check conditions for impossible cases
        for i in z:
            if n - z1[i] < z[i] or (z[i] >= n//2 + 1 and z1[i] >= n//2 + 1):
                return -1
        for i in z1:
            if n - z[i] < z1[i] or (z[i] >= n//2 + 1 and z1[i] >= n//2 + 1):
                return -1

        ans = 0
        d = defaultdict(list)
        vis = [0 for _ in range(n)]

        for i in range(n):
            if nums1[i] == nums2[i]:
                z[nums2[i]] += 1
                ans += i
                d[nums2[i]].append(i)

        t = 0
        l = z.most_common(len(z))
        a = 0
        for i in range(1, len(l)):
            a += l[i][1]
            for j in d[l[i][0]]:
                vis[j] = 1
            z[l[i][0]] = 0

        # Check if already satisfied
        if l and a >= l[0][1]:
            return ans

        x = 0
        if l:
            x = l[0][1] - a
            z[l[0][0]] = x

        for j in z:
            if z[j]:
                for i in range(n):
                    if vis[i] == 0 and nums1[i] == j and nums2[i] == j and x > 0: 
                        ans += i
                        x -= 1

        return ans

